    "distribution-and-abundance-of-sea-otters-in-the-kenai-fiords-may-to-september-1982",nt"isopen":
    false,nt"url": null,nt"notes": "This report covers the distribution and
    abundance of sea otters in the Kenai Fjords during May to September 1982. The goal
    of this study was to gather baseline information converging sea otters that would
    assist the USFWS in determining the necessity and feasibility of controlling sea
    otter numbers in areas of conflict with shellfish user groups. Included in the report
    are the methods, results, and discussion, and survey areas.",nt"license_title":
